import atomize from "@quarkly/atomize";
import { commonTextProps, commonTextPropsDefaults } from "./text";
var config = {
  name: "Strike",
  normalize: true,
  mixins: true,
  description: {
    en: "Strike text",
    ru: "Strike text"
  },
  propInfo: commonTextProps
};
export var Strike = atomize("strike")(config, commonTextPropsDefaults);
export var S = atomize.s(config, commonTextPropsDefaults);
